import React, { useEffect, useState } from 'react';
import Card from 'react-bootstrap/Card';

import Button from 'react-bootstrap/Button';
import Navbar from '../navSection/Navbar';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import { Link, useNavigate } from 'react-router-dom';
import Footer from '../footerSection/Footer';
import axios from 'axios';

import { useDispatch, useSelector } from 'react-redux';
import { fetchSuccess } from '../redux/userSlice';
import Error from '../utils/Error';
import { shippingSuccess } from '../redux/shippingSlice';

function Shipping() {
  const [name, setName] = useState('');
  const [localGvt, setLocalGvt] = useState('');
  const [country, setCountry] = useState('');
  const [street, setStreet] = useState('');
  const [state, setState] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [error, setError] = useState(null);
  const dispatch = useDispatch();
  const { userInfo } = useSelector((state) => state.user);

  const shippingAddress = {
    name: 'jude igwe',
    state: 'abeoukuta',
    phoneNumber: 7084736283,
    country: 'united nations',
    street: '473 block adb of ohio',
    localGvt: 'oiahata',
  };

  const handleShipping = async (e) => {
    e.preventDefault();
    if (name || localGvt || phoneNumber || country || street || state) {
      dispatch(
        shippingSuccess(name, localGvt, phoneNumber, country, street, state)
      );
    } else {
      setError("Fill the missing fields");
    }
  };

  return (
    <div style={{ maxWidth: '600px', minWidth:"500px" }} className='p-'>
      <Card>
        <Card.Body>
          <div>
          

            <div
              className="d-flex justify-content-center my-5 flex-column align-items-center"
              style={{ width: '100%' }}
            >
              <strong className='fs-4'>Shipping Info</strong>
              <Form onSubmit={handleShipping}>
                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>Name</InputGroup.Text>
                  <Form.Control
                    type="text"
                    onChange={(e) => setName(e.target.value)}
                    required={true}
                    placeholder=' write name here'
                  />
                </InputGroup>

                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>Local-Gvt-Area</InputGroup.Text>
                  <Form.Control
                    type="text"
                    onChange={(e) => setLocalGvt(e.target.value)}
                    required={true}
                    placeholder=' write LGA here'
                  />
                </InputGroup>
                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>State</InputGroup.Text>
                  <Form.Control
                    type="text"
                    onChange={(e) => setState(e.target.value)}
                    required
                    placeholder=' write state here'
                  />
                </InputGroup>
                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>Country</InputGroup.Text>
                  <Form.Control
                    type="text"
                    onChange={(e) => setCountry(e.target.value)}
                    required
                    placeholder='write country here'
                  />
                </InputGroup>
                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>PhoneNumber</InputGroup.Text>
                  <Form.Control
                    type="number"
                    onChange={(e) => setPhoneNumber(e.target.value)}
                    required
                    placeholder=' write number here'
                  />
                </InputGroup>
                <InputGroup className="my-3">
                  <InputGroup.Text className='fw-bold'>Street</InputGroup.Text>
                  <Form.Control
                    type="text"
                    onChange={(e) => setStreet(e.target.value)}
                    required
                  />
                </InputGroup>

                <div className="d-flex gap-3 align-items-center my-3">
                  <Button
                    variant="danger"
                    className="bg-danger fw-bold"
                    type="submit"
                  >
                    Cancel
                  </Button>
                  <Button
                    variant="success"
                    className="bg-success fw-bold"
                    type="submit"
                  >
                    Comfirm
                  </Button>
                </div>
              </Form>

              {error !== null && <Error error={error} />}
            </div>
          </div>
        </Card.Body>
      </Card>
    </div>
  );
}

export default Shipping;
